import React from "react";
//import { NavLink } from "react-router-dom";
import {Link} from 'react-scroll';


export const Navbar = () => {
  return (
      <div className='navbar'>
      <div className='logo'>
        <img className='logo-class' src={process.env.PUBLIC_URL + '/name_icon.png'} alt='logo'/>
      </div>
      <ul className='navlinks'>
        <li><Link className='nav-item' activeClass='active' to='/' spy={true} smooth={true} offset={50} duration={500}>Home</Link></li>
        <li><Link className='nav-item' activeClass='active' to='about' spy={true} smooth={true} offset={50} duration={500}>About</Link></li>
        <li><Link className='nav-item' activeClass='active' to='projects' spy={true} smooth={true} offset={50} duration={500}>Projects</Link></li>
        <li><Link className='nav-item' activeClass='active' to='contact' spy={true} smooth={true} offset={50} duration={500}>Contact</Link></li>

      </ul>
      </div>

  );
};

export default Navbar;
